import React from "react";
import Cards from "./Cards";
import "./CardList.css";

const CardList = props => {
  const { posts } = props;
  return (
    <div className="main">
      {posts.map((user, i) => {
        return <h1>{user[i]}</h1>;
      })}
    </div>
  );
};

export default CardList;
